import React, { useState, useEffect } from 'react';

const Map = () => {
  const [currentLocation, setCurrentLocation] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Verifica si la geolocalización es compatible con el navegador
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          // Si se obtiene la ubicación correctamente
          setCurrentLocation({
            latitude: position.coords.latitude,
            longitude: position.coords.longitude
          });
        },
        (error) => {
          // Manejo de diferentes tipos de error
          switch (error.code) {
            case error.PERMISSION_DENIED:
              setError("El usuario ha denegado el acceso a la ubicación.");
              break;
            case error.POSITION_UNAVAILABLE:
              setError("No se pudo obtener la ubicación.");
              break;
            case error.TIMEOUT:
              setError("La solicitud de geolocalización ha superado el tiempo de espera.");
              break;
            default:
              setError("Error desconocido al obtener la ubicación.");
              break;
          }
        }
      );
    } else {
      setError("La geolocalización no es compatible con este navegador.");
    }
  }, []);

  return (
    <div>
      {error && <div className="error">{error}</div>}
      {currentLocation ? (
        <div>
          <p>Latitud: {currentLocation.latitude}</p>
          <p>Longitud: {currentLocation.longitude}</p>
        </div>
      ) : (
        <div>Obteniendo ubicación...</div>
      )}
    </div>
  );
};

export default Map;
